INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES ("2030/12/17 14:59:59", 0.0, 24001, 0.0, 401, "やったね、ぷうきち！\nこれならお兄ちゃんたちの\nお手本になれたよね！", 2, 102301, 10046, "2020/07/31 12:00:00", 0.0, 2, 24, "アヤネ");
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES ("2030/12/17 14:59:59", 0.0, 24002, 0.0, 402, "私たちの勝ちだね！\nぷうきちと一緒なら\nどんなボールでも\nホームランを打ってみせるよ！", 1, 102301, 10046, "2020/07/31 12:00:00", 2.21, 2, 24, "アヤネ");
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES ("2030/12/17 14:59:59", 0.0, 24003, 0.0, 403, "やったやったぁ！\nお兄ちゃん、見ててくれた？\n私、すっごくがんばったよ！", 2, 102301, 10046, "2020/07/31 12:00:00", 0.0, 2, 24, "アヤネ");
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES ("2030/12/17 14:59:59", 0.0, 24004, 0.0, 701, "特訓の成果が出たみたいだ！\nもっと練習を重ねて\nこの調子で上達していこう！", 2, 192201, 10046, "2020/07/31 12:00:00", 1.99, 1, 24, "アサヒ");
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES ("2030/12/17 14:59:59", 0.0, 24005, 0.0, 702, "よし、いい感じだ！\nキャプテンとしての仕事は\nきっちり果たせそうだよ", 1, 192201, 10046, "2020/07/31 12:00:00", 2.21, 2, 24, "アサヒ");
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES ("2030/12/17 14:59:59", 0.0, 24006, 0.0, 703, "試合に向けて\nいい感覚を掴めた気がするよ！\nこのまま一気に全国大会だ！", 2, 192201, 10046, "2020/07/31 12:00:00", 3.33, 1, 24, "アサヒ");
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES ("2030/12/17 14:59:59", 0.0, 24007, 0.0, 801, "このくらい余裕だ\nオレたちは全国大会を\n目指してるんだからな", 2, 192301, 10046, "2020/07/31 12:00:00", 0.0, 2, 24, "部員３");
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES ("2030/12/17 14:59:59", 0.0, 24008, 0.0, 802, "オレだって\nビーチベースボール選手だ\nどんな球だろうが\n全部スタンドまで飛ばしてやる", 1, 192301, 10046, "2020/07/31 12:00:00", 2.68, 2, 24, "部員３");
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES ("2030/12/17 14:59:59", 0.0, 24009, 0.0, 803, "いい感じだ\nこれなら試合でも活躍できそうだ\n大暴れしてやる！", 2, 192301, 10046, "2020/07/31 12:00:00", 0.0, 2, 24, "部員３");
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES ("2030/12/17 14:59:59", 0.0, 24010, 0.0, 501, "やった！", 1, 192501, 10046, "2020/07/31 12:00:00", 0.0, 1, 24, "");
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES ("2030/12/17 14:59:59", 0.0, 24011, 0.0, 502, "勝ったよ！", 1, 192501, 10046, "2020/07/31 12:00:00", 0.0, 1, 24, "");
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES ("2030/12/17 14:59:59", 0.0, 24012, 0.0, 503, "いい調子！", 1, 192501, 10046, "2020/07/31 12:00:00", 0.0, 1, 24, "");
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES ("2030/12/17 14:59:59", 0.0, 24013, 0.0, 111, "あら～…もしかして\n勝っちゃったのかしら？\nみんなの練習を見ていたから\nかもしれないわね", 6, 113501, 10046, "2020/07/31 12:00:00", 5.33, 2, 24, "ミサト");
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES ("2030/12/17 14:59:59", 0.0, 24014, 0.0, 112, "みんなの力になりたくて\n先生も頑張ってみました～！\nうまく投げられたみたいで\nよかったわ～！", 1, 113501, 10046, "2020/07/31 12:00:00", 6.85, 2, 24, "ミサト");
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES ("2030/12/17 14:59:59", 0.0, 24015, 0.0, 113, "練習お疲れさま～！\n先生も協力できて\nとってもうれしいわ～♪\n次も頑張りましょうね～！", 1, 113501, 10046, "2020/07/31 12:00:00", 3.0, 2, 24, "ミサト");
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES ("2030/12/17 14:59:59", 0.0, 24016, 0.0, 611, "まだ練習が足りねえみてえだな\nこれっぽっちも本気で\n投げてねえっつーの\nもう一回やんぞ！", 1, 192401, 10046, "2020/07/31 12:00:00", 6.11, 2, 24, "ダイチ");
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES ("2030/12/17 14:59:59", 0.0, 24017, 0.0, 612, "ふん、当然の結果だな\n俺の球は、誰にも打てねえよ！\nまたやりてえっつーなら\nとことん付き合ってやるぜ！", 1, 192401, 10046, "2020/07/31 12:00:00", 6.75, 2, 24, "ダイチ");
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES ("2030/12/17 14:59:59", 0.0, 24018, 0.0, 613, "おっしゃあ！\nこの勢いで全国に行ってやるぜ！\n全員三振で仕留めてやる！", 2, 192401, 10046, "2020/07/31 12:00:00", 0.0, 2, 24, "ダイチ");
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES ("2030/12/17 14:59:59", 0.0, 24019, 0.0, 211, "きらーん☆\nハツネちゃんの大勝利なのだ～！\nみんながもっと上達できるように\n私もまだまだ頑張るからね！", 2, 113401, 10046, "2020/07/31 12:00:00", 4.52, 1, 24, "ハツネ");
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES ("2030/12/17 14:59:59", 0.0, 24020, 0.0, 212, "やったあ！　私の勝ちだね！\nチアリーダーもピッチャーも\nハツネちゃんに任せてよ！", 2, 113401, 10046, "2020/07/31 12:00:00", 3.89, 1, 24, "ハツネ");
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES ("2030/12/17 14:59:59", 0.0, 24021, 0.0, 213, "よお～し、この調子でもっと\n頑張ろう…と思ったけど\n超能力を使ったから…\n眠くなってきちゃった…すやぁ…", 1, 113401, 10046, "2020/07/31 12:00:00", 13.49, 2, 24, "ハツネ");
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES ("2030/12/17 14:59:59", 0.0, 24022, 0.0, 311, "いい勝負だったぜ！\nたぎっちまって\nつい本気で投げちまったよ", 1, 106501, 10046, "2020/07/31 12:00:00", 3.17, 2, 24, "カヤ");
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES ("2030/12/17 14:59:59", 0.0, 24023, 0.0, 312, "どうだ？\nオレ様のボールは熱かっただろ！\nま、でもおまえらの根性も\nなかなかのもんだったぜ", 1, 106501, 10046, "2020/07/31 12:00:00", 4.42, 2, 24, "カヤ");
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES ("2030/12/17 14:59:59", 0.0, 24024, 0.0, 313, "なんだよ、そんなもんか？\nこっちはまだまだ投げたりねえ\nもっと勝負しようぜ！", 6, 106501, 10046, "2020/07/31 12:00:00", 2.89, 1, 24, "カヤ");
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES ("2030/12/17 14:59:59", 0.0, 24025, 0.0, 421, "あとちょっとだったのに～！\n次こそぷうきちと一緒に\n勝ってみせるからね！", 4, 102301, 10046, "2020/07/31 12:00:00", 3.71, 3, 24, "アヤネ");
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES ("2030/12/17 14:59:59", 0.0, 24026, 0.0, 721, "いい勝負だったね！\nでも、やっぱり悔しいな…\nもっと練習して\n今度は絶対に俺が勝つから！", 2, 192201, 10046, "2020/07/31 12:00:00", 5.1, 1, 24, "アサヒ");
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES ("2030/12/17 14:59:59", 0.0, 24027, 0.0, 821, "ちっ…あと一歩足りなかったか\n次こそは絶対に勝つから\nそのつもりでいろ", 1, 192301, 10046, "2020/07/31 12:00:00", 4.34, 3, 24, "部員３");
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES ("2030/12/17 14:59:59", 0.0, 24028, 0.0, 521, "いい勝負だったよ\nまたやろうね", 1, 192501, 10046, "2020/07/31 12:00:00", 0.0, 1, 24, "");
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES ("2030/12/17 14:59:59", 0.0, 24029, -360.0, 101, "とってもよくできました～♪\n頑張ってくれて先生うれしいわ\nこれからも試合に向けて\n練習していきましょうね～", 1, 113501, 10046, "2020/07/31 12:00:00", 5.62, 2, 24, "ミサト");
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES ("2030/12/17 14:59:59", 0.0, 24030, -360.0, 102, "頑張った成果ね～！\nこのまま練習を続ければ\nもっとすごい成績を残せそうよ\n期待してますからね～！", 1, 113501, 10046, "2020/07/31 12:00:00", 9.58, 2, 24, "ミサト");
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES ("2030/12/17 14:59:59", 0.0, 24031, -360.0, 103, "いい子、いい子～♪\n頑張り屋さんのあなたを\nたっくさん褒めてあげますからね", 2, 113501, 10046, "2020/07/31 12:00:00", 0.0, 2, 24, "ミサト");
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES ("2030/12/17 14:59:59", 0.0, 24032, -360.0, 104, "夢に向けて、一歩前進できたわね\nこの調子で、夢を叶えましょう\n目指せ、全国大会～！", 2, 113501, 10046, "2020/07/31 12:00:00", 9.13, 1, 24, "ミサト");
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES ("2030/12/17 14:59:59", 0.0, 24033, -360.0, 105, "絶好調ね～♪\nきっと試合でも大活躍\n間違いなしだわ\n楽しみにしていますからね～！", 1, 113501, 10046, "2020/07/31 12:00:00", 8.27, 2, 24, "ミサト");
